INSERT INTO `about` (`about_id`, `about`, `about_img`) VALUES
(2, '<p>My name is <strong>Ahsan Ahmed</strong>, experienced creative fullstack web developer. I was born and grown up in old Dhaka. Besides so many fairy tales, i have been growing up a</p><p>dream of doing something technology based and that made me join Computer Science and Engineering course</p><p>at Eastern University. Joining the most lovable subject, i have acquired good results and participated in so many</p><p>projects. While doing projects, i have sharpened my skill and &nbsp;learned to be hardworking, patience, critical problem solving,</p><p>and client management. Getting appreciation from Teachers, Colleagues, and clients, i have developed confidence in</p><p>doing any kind of projects and client management.</p><p>Besides web development, i also have keen interest towards Graphics designing.</p><p>You Can Hire Me To Develop your dream projects. I believe in long term relationships.</p>', '2.jpg');
